import React from 'react';
import moment from "moment";
import windIncon from "./icons/wind2.ico" ;
import humidity from "./icons/waterdrop.ico";
import precipitation from "./icons/rain.ico";


class Todayweather extends React.Component()  {

  redner(){

return(

<div className="weather-container">


      <div className="w-container">

        <main class= "w-body">

                    <p className="city-text">{this.props.City}</p>
                    <p className="date-text">{moment().format("dddd "+'LL')}</p>


                    <p className="temp">{Math.round(this.props.temperature)}&deg;C</p>
                    <img className="main-icon" src={this.props.Icon}></img>

              <div className="wph-box">
                    <div className="wind">
                          <img className="icon-drop" src={windIncon}></img>
                          <p className="drop-text">{Math.round(this.props.Wind)} mph</p>
                          </div>
                    <div className="humidity">
                          <img className="icon-drop" src={humidity}></img>
                          <p className="drop-text">{Math.round(this.props.Humidity)} %</p>
                          </div>
                    <div className="couldCover">
                          <img className="icon-drop" src={precipitation}></img>
                         <p className="drop-text">{this.props.Description}</p>
                          </div>
              </div>
        </main>
        </div>


</div>
)
}
}

export default Todayweather;
